  const { movies, series } = data;

  return (
    <main>
      <nav>
        <Link className="link" to="/Movies">
          <h3>Movies</h3>
        </Link>

        <Link className="link" to="/Series">
          <h3>Series</h3>
        </Link>
      </nav>
      <ul>
        <Routes>
          <Route
            path="/"
